from sympy import mod_inverse

def decrypt(encrypted_message, private_key):
    n, d = private_key
    decrypted_message = pow(encrypted_message, d, n)
    return decrypted_message.to_bytes((decrypted_message.bit_length() + 7) // 8, 'big').decode()

